function setClassNotNull() {
  const emailInput = document.getElementById('emailInput');
  const errorSymbol = document.getElementById('errorSymbol');
  const errorText = document.getElementById('emailInput');

  if (emailInput.className === 'emailInput' && errorSymbol.className === 'errorSymbol -disabled' && errorText.className === 'errorText -disabled') emailInput.setAttribute('class', 'emailInput -notNull');
  errorSymbol.setAttribute('class', 'errorSymbol');
  errorText.setAttribute('class', 'errorText');
}

export default setClassNotNull;
